  document.querySelector( '#overlay' )
      .style.display = "block";
  valEl.focus();
  valEl.select();
}

function draw ( val ) {
  var spriteWidth = image.width / 2
      , spriteHeight = image.height / 1
      , text = (parseInt(val) || value).toString(2)
      , textLength = text.length
      , digWidth = ( width / ( textLength + 1 ) ) | 0
      , digHeight = Math.min( digWidth, height )
      , digX, digY, i
      ;
  digWidth > digHeight && (digWidth = digHeight);
  digX = ( ( width - digWidth * textLength )
      / 2 ) | 0;
  digY = ( ( height - digHeight ) / 2 ) | 0;
  context.clearRect( 0, 0, width, height );
  i = 0;
  do {
    c = text[i++];
    context.drawImage( image
        , c * spriteWidth
        , 0, spriteWidth, spriteHeight
        , digX, digY, digWidth, digHeight );
    digX += digWidth
  } while ( i < textLength );
}

function resize ( wid, hei ) {
  width = parseInt(wid) || window.innerWidth;
  height = parseInt(hei) || window.innerHeight;
  canvas.width = width;
  canvas.height = height;
  isNaN( value ) || value < 0 || draw( );
}

function parseQuery ( query ) {
  var result = {}
      , parts = ( query
          || (query = location.search.slice( 1 )) )
          .split( '&' )
      , p
      ;
  parts.forEach( part => {
    if ( (p = part.indexOf( '=' )) < 0 ) {
      result.value = decodeURIComponent( part )
    } else {
      result[decodeURIComponent( part.slice( 0, p ) )] = decodeURIComponent( part.slice( p + 1 ) )
    }
  } );
  
  return result
}
